givenname}},\n\n            We received a request to recover your account user name. The account associated with us indicates that the\n            user name is : {{userstore-domain}}/{{user-name}}@{{tenant-domain}}\n        |\n            Best Regards,\n            WSO2 Carbon Team\n            http://www.wso2.com\n        ',-1234),(1204,'passwordReset','WSO2 Carbon - Password Reset|\n            Hi {{user.claim.givenname}},\n\n            We received a request to change the password on the {{user-name}} account associated with this e-mail address.\n            If you made this request, please click the link below to securely change your password:\n\n            https://localhost:9443/accountrecoveryendpoint/confirmrecovery.do?confirmation={{confirmation-code}}&userstoredomain={{userstore-domain}}&username={{url:user-name}}&tenantdomain={{tenant-domain}}&callback={{callback}}\n\n            If clicking the link doesn\'t seem to work, you can copy and paste the link into your browser\'s address\n            window.\n\n            If you did not request to have your {{user-name}} password reset, simply disregard this email and no changes\n            to your account will be made.\n        |\n            Best Regards,\n            WSO2 Carbon Team\n            http://www.wso2.com\n        ',-1234),(1205,'temporaryPassword','WSO2 Carbon - Temporary Password|\n            Hi {{user.claim.givenname}},\n\n            Please find your temporary password below.\n\n            User Name: {{user-name}}\n            Temporary Password: {{temporary-password}}\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1206,'adminforcedpasswordresetwithotp','WSO2 - Admin Forced Password Reset|\n            Hi {{user.claim.givenname}},\n\n            We received a request to change the password on the {{user-name}} account associated with this e-mail address.Please use below OTP as the password at next login and then reset your password.\n\n            OTP : {{confirmation-code}}\n\n        |\n            Best Regards,\n            WSO2 Carbon Team\n            http://www.wso2.com\n        ',-1234),(1207,'initiateRecovery','WSO2 Carbon - You started to reset password|\n            Hi {{user.claim.givenname}},\n\n            This is to notify that you have initiate to reset your password using security questions.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1208,'emailConfirm','WSO2 Carbon - Email Confirmation|\n            Hi {{user.claim.givenname}},\n\n            You have created an account with following user name\n\n            User Name: {{user-name}}\n\n            Please click the following link to unlock. If clicking the link doesn\'t seem to work, you can copy and paste\n            the\n            link into your browser\'s address window.\n\n            https://localhost:9443/accountrecoveryendpoint/confirmregistration.do?confirmation={{confirmation-code}}&userstoredomain={{userstore-domain}}&username={{url:user-name}}&tenantdomain={{tenant-domain}}\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1209,'accountDisable','WSO2 Carbon - Your account disabled|\n            Hi {{user.claim.givenname}},\n\n            Please note that the account registered with us with the user name : {{user-name}} has been disabled.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1210,'accountConfirmation','WSO2 Carbon - Account Confirmation|\n            Hi {{user.claim.givenname}},\n\n            You have created an account with following user name\n\n            User Name: {{user-name}}\n\n            Please click the following link to unlock. If clicking the link doesn\'t seem to work, you can copy and paste\n            the\n            link into your browser\'s address window.\n\n            https://localhost:9443/accountrecoveryendpoint/confirmregistration.do?confirmation={{confirmation-code}}&userstoredomain={{userstore-domain}}&username={{url:user-name}}&tenantdomain={{tenant-domain}}&callback={{callback}}\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1211,'passwordResetSucess','WSO2 Carbon - Your Password Reset successfully|\n            Hi {{user.claim.givenname}},\n\n            Please note that your password reset operation is successfully completed.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1212,'accountLock','WSO2 Carbon - Your account Locked|\n            Hi {{user.claim.givenname}},\n\n            Please note that the account registered with us with the user name : {{user-name}} has been locked.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1213,'idleAccountReminder','WSO2 Carbon - Your account is inactive|\n            Hi {{user.claim.givenname}},\n\n            It looks as though you haven\'t signed in to your account for quite a while. Please sign in to your account if you\'d like to keep your account active.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1214,'accountEnable','WSO2 Carbon - Your account enabled|\n            Hi {{user.claim.givenname}},\n\n            Please note that the account registered with us with the user name : {{user-name}} has been enabled.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1215,'askPassword','WSO2 Carbon - Password Change for New Account|\n            Hi {{user.claim.givenname}},\n\n            Please change your password for the newly created account : {{user-name}}. Please click the link below to\n            create the password.\n\n            https://localhost:9443/accountrecoveryendpoint/confirmrecovery.do?confirmation={{confirmation-code}}&userstoredomain={{userstore-domain}}&username={{url:user-name}}&tenantdomain={{tenant-domain}}\n            If clicking the link doesn\'t seem to work, you can copy and paste the\n            link into your browser\'s address window.\n        |\n            Best Regards,\n            WSO2 Carbon Team\n            http://www.wso2.com\n        ',-1234),(1216,'accountUnLock','WSO2 Carbon - Your account unlocked|\n            Hi {{user.claim.givenname}},\n\n            Please note that the account registered with us with the user name : {{user-name}} has been unlocked.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1217,'adminforcedpasswordreset','WSO2 - Admin Forced Password Reset|\n            Hi {{user.claim.givenname}},\n\n            Please change your password for the account : {{user-name}}. Please click the link below to\n            change the password.\n\n            https://localhost:9443/accountrecoveryendpoint/confirmrecovery.do?confirmation={{confirmation-code}}&userstoredomain={{userstore-domain}}&username={{url:user-name}}&tenantdomain={{tenant-domain}}\n\n            If clicking the link doesn\'t seem to work, you can copy and paste the\n            link into your browser\'s address window.\n        |\n            Best Regards,\n            WSO2 Carbon Team\n            http://www.wso2.com\n        ',-1234),(1218,'otp','WSO2 Carbon - One Time Password Reset|\n            Hi {{user.claim.givenname}},\n\n            Please use the password {{otp-password}} as the new password for your next login.\n        |\n            Best Regards,\n            WSO2 Identity Server Team\n            http://www.wso2.com\n        ',-1234),(1219,'resendAccountConfirmation','WSO2 